import style from "./Login.module.css";

const Login = () => {
  const [login, setLogin] = useState({ nameUser: "", password: "" });
  return (
    <form>
      <div className={style.mainContainer}>
        <label>User</label>
        <input type="text" />
        <label>Password</label>
        <input />
        <button type="submit">Login</button>
      </div>
    </form>
  );
};

export default Login;
